import { Text, View } from 'react-native';
import Account from './ProfileScreen';

const DummyScreen = () => {
    return (
        <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
            <Text>Dummy screen for testing</Text>
            <Account/>

        </View>  
    )
}

export default DummyScreen;
